import React from 'react';
import { Link, Route, Switch } from 'react-router-dom';



const Dashboard = () => (
  <div>
    <h2>Dashboard</h2>
    {/* Add Book, Delete Book, Update Book, View Status buttons here */}
  </div>
);

const AddBook = () => (
  <div>
    <h2>Add Book</h2>
    {/* Your Add Book component content here */}
  </div>
);

const DeleteBook = () => (
  <div>
    <h2>Delete Book</h2>
    {/* Your Delete Book component content here */}
  </div>
);

const UpdateBook = () => (
  <div>
    <h2>Update Book</h2>
    {/* Your Update Book component content here */}
  </div>
);

const ViewStatus = () => (
  <div>
    <h2>View Status</h2>
    {/* Your View Status component content here */}
  </div>
);

const AdminNavbar = () => {
  return (
    <div className="container-fluid px-0">
      <nav className="navbar navbar-expand-lg navbar-dark bg-black py-4 px-0">
        {/* ... same as before ... */}
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item active">
              <Link className="nav-link" style={{ fontSize: '24px' }} to="/dashboard">
                Dashboard
              </Link>
            </li>
            {/* Add links for Add Book, Delete, Update, View Status */}
          </ul>
        </div>

        <button className="btn btn-danger" style={{ fontSize: '30px' }}>
          Logout
        </button>
        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;

        {/* Add a Switch to conditionally render components based on the route */}
        <Switch>
          <Route path="/dashboard" component={Dashboard} />
          <Route path="/add-book" component={AddBook} />
          <Route path="/delete-book" component={DeleteBook} />
          <Route path="/update-book" component={UpdateBook} />
          <Route path="/view-status" component={ViewStatus} />
        </Switch>
      </nav>
    </div>
  );
};

export default AdminNavbar;
